(6, 3, 'Meet lakhani', 'Fashion design is the art of applying design, aesthetics, clothing construction and natural beauty to clothing and its accessories. It is influenced by culture and different trends, and has varied over time and place. \"A fashion designer creates clothing, including dresses, suits, pants, and skirts, and accessories like shoes and handbags, for consumers. He or she can specialize in clothing, accessory, or jewelry design, or may work in more than one of these areas.\"', 'edb5a63ac8edffcd29304dbda9ccd88b.jpg', 22, '2001-02-06', 0, 'Surat', 0, '25000', 419, '2023-05-30 09:30:00.000000', '2023-06-02 07:29:00.000000', 0),
(7, 2, 'Vasi', 'A model is a person who has the job of using their body to pose for art, or to show fashion items, such as clothes or jewellery. Models often appear in advertising on television and in print media, for example newspapers and magazines, or on the web.', '548149990217b927a14631ba7c865faf.jpg', 27, '1996-03-14', 1, 'usa', 0, '50000', 113, '2023-05-30 10:26:00.000000', '2023-06-02 07:28:00.000000', 0),
(8, 2, 'Meet', 'A model is a person who has the job of using their body to pose for art, or to show fashion items, such as clothes or jewellery. Models often appear in advertising on television and in print media, for example newspapers and magazines, or on the web.', 'ae45377cbf7b7e41b5ed9d58f1268610.jpg', 0, '2023-05-09', 0, '', 0, '', 194, '2023-05-30 13:03:00.000000', '2023-06-02 07:28:00.000000', 0);
